import React, { useRef } from 'react';
import { withFormik, FormikProps } from 'formik';
import * as Yup from 'yup';

interface FormValues {
  email?: string;
  password?: string;
}

interface OtherProps {
  title?: string;
  ref?: any;
}
interface MyFormprops {
  initialEmail?: string;
  initialPassword?: string;
  login?: any;
}

const InnerForm = (props: OtherProps & FormikProps<FormValues>) => {
  const {
    values,
    errors,
    touched,
    handleChange,
    handleBlur,
    handleSubmit,
    isSubmitting,
    ref,
  } = props;

  return (
    <>
      <main className="form-signin">
        <form onSubmit={handleSubmit}>
          <div className="form-floating">
            <input
              type="email"
              className="form-control"
              name="email"
              id="floatingInput"
              onChange={handleChange}
              onBlur={handleBlur}
              value={values.email}
            />
            <label htmlFor="floatingInput">EmailAddress</label>
          </div>
          {touched.email && errors.email && (
            <div style={{ display: 'auto' }} className="invalid-feedback">
              {errors.email}
            </div>
          )}
          <div className="form-floating mt-3">
            <input
              type="password"
              className="form-control"
              name="password"
              id="floatingPassword"
              placeholder="Password"
              onChange={handleChange}
              onBlur={handleBlur}
              value={values.password}
            />
            <label htmlFor="floatingPassword">Password</label>
          </div>
          {touched.password && errors.password && (
            <div style={{ display: 'auto' }} className="invalid-feedback">
              {errors.password}
            </div>
          )}
          <button
            disabled={
              isSubmitting ||
              !!(errors.email && touched.email) ||
              !!(errors.password && touched.password)
            }
            className="w-100 btn btn-lg btn-warning"
            type="submit"
          />
        </form>
      </main>
    </>
  );
};

const LoginForm = withFormik<MyFormprops, FormValues>({
  mapPropsToValues: (props) => ({
    email: props.initialEmail,
    password: props.initialPassword,
  }),
  validationSchema: Yup.object().shape({
    email: Yup.string()
      .email('Email isnot valid')
      .required('Email is required'),
    password: Yup.string().required('Password is required'),
  }),
  handleSubmit({ email, password }: FormValues) {
    console.log('Email', email);
    console.log('Password', password);
  },
})(InnerForm);

const Login: React.FC<{}> = (props: any) => (
  <div>
    <LoginForm />
  </div>
);

export default Login;
